import { useNavigation } from "@react-navigation/native";
import React from "react";
import {StyleSheet, Text,TouchableOpacity,View,SafeAreaView,Image} from "react-native";




export default function Dashboard(){

    const navigation=useNavigation()
    
    return(
         <SafeAreaView style={styles.container}>
         <View  style={styles.textImage}>
          <Image style={styles.Image} source={require("../../../assets/BARBA.jpg")} />
          
          </View> 
          <View  style={styles.textImage}>
          <Image style={styles.Image1} source={require("../../../assets/BARBEIRO1.jpg")} />
          <Text style={stylestext1}>Patrick Malungo</Text>
          </View> 
          <View  style={styles.textImage}>
          <Image style={styles.Image1} source={require("../../../assets/BARBEIRO3.jpg")} />
          <Text style={stylestext1}>Anderson da silva</Text>
          </View> 
          <View  style={styles.textImage}>
          <Image style={styles.Image1} source={require("../../../assets/BARBEIRO4.jpg")} />
          <Text style={stylestext1}>Anderson da silva</Text>
          </View> 
          
          
        <TouchableOpacity onPress={()=> navigation.navigate("Big")}>
        </TouchableOpacity>
        </SafeAreaView>
    )
}
 const styles=StyleSheet.create({
    container:{
        fle:1,
        backgroundColor:"#000",
    },
    text:{
    marginTop:30,
     marginBottom:30,
    fontSize:30,
    color:'#D92938',
